import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container, TextField, Button, Typography, Box, List, ListItem, ListItemText,
  IconButton, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';

function Matches() {
  const [matches, setMatches] = useState([]);
  const [team1, setTeam1] = useState('');
  const [team2, setTeam2] = useState('');
  const [score1, setScore1] = useState('');
  const [score2, setScore2] = useState('');
  const [editMatch, setEditMatch] = useState(null);
  const [deleteMatch, setDeleteMatch] = useState(null);

  useEffect(() => {
    fetchMatches();
  }, []);

  const fetchMatches = async () => {
    try {
      const response = await axios.get('http://localhost:3000/api/matches', {
        headers: { Authorization: `Bearer ${sessionStorage.getItem('token')}` }
      });
      setMatches(response.data);
    } catch (error) {
      console.error('Error fetching matches:', error);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (editMatch) {
      try {
        const response = await axios.put(`http://localhost:3000/api/matches/${editMatch._id}`, { team1, team2, score1, score2 }, {
          headers: { Authorization: `Bearer ${sessionStorage.getItem('token')}` }
        });
        setMatches(matches.map((match) => (match._id === editMatch._id ? response.data : match)));
        setEditMatch(null);
        setTeam1('');
        setTeam2('');
        setScore1('');
        setScore2('');
      } catch (error) {
        console.error('Error updating match:', error);
      }
    } else {
      try {
        const response = await axios.post('http://localhost:3000/api/matches', { team1, team2, score1, score2 }, {
          headers: { Authorization: `Bearer ${sessionStorage.getItem('token')}` }
        });
        setMatches([...matches, response.data]);
        setTeam1('');
        setTeam2('');
        setScore1('');
        setScore2('');
      } catch (error) {
        console.error('Error creating match:', error);
      }
    }
  };

  const handleEdit = (match) => {
    setEditMatch(match);
    setTeam1(match.team1);
    setTeam2(match.team2);
    setScore1(match.score1);
    setScore2(match.score2);
  };

  const handleDelete = async () => {
    try {
      await axios.delete(`http://localhost:3000/api/matches/${deleteMatch._id}`, {
        headers: { Authorization: `Bearer ${sessionStorage.getItem('token')}` }
      });
      setMatches(matches.filter((match) => match._id !== deleteMatch._id));
      setDeleteMatch(null);
    } catch (error) {
      console.error('Error deleting match:', error);
    }
  };

  return (
    <Container maxWidth="md">
      <Box sx={{ mt: 8 }}>
        <Typography variant="h4" gutterBottom>Matches</Typography>
        <form onSubmit={handleSubmit}>
          <TextField
            label="Team 1"
            fullWidth
            value={team1}
            onChange={(e) => setTeam1(e.target.value)}
            required
            margin="normal"
          />
          <TextField
            label="Team 2"
            fullWidth
            value={team2}
            onChange={(e) => setTeam2(e.target.value)}
            required
            margin="normal"
          />
          <TextField
            label="Score 1"
            fullWidth
            value={score1}
            onChange={(e) => setScore1(e.target.value)}
            required
            margin="normal"
          />
          <TextField
            label="Score 2"
            fullWidth
            value={score2}
            onChange={(e) => setScore2(e.target.value)}
            required
            margin="normal"
          />
          <Button type="submit" variant="contained" color="primary" fullWidth sx={{ mt: 2 }}>
            {editMatch ? 'Update Match' : 'Add Match'}
          </Button>
        </form>
        <List sx={{ mt: 4 }}>
          {matches.map((match) => (
            <ListItem key={match._id} secondaryAction={
              <>
                <IconButton edge="end" aria-label="edit" onClick={() => handleEdit(match)}>
                  <EditIcon />
                </IconButton>
                <IconButton edge="end" aria-label="delete" onClick={() => setDeleteMatch(match)}>
                  <DeleteIcon />
                </IconButton>
              </>
            }>
              <ListItemText primary={`${match.team1} vs ${match.team2} - ${match.score1}:${match.score2}`} />
            </ListItem>
          ))}
        </List>

        <Dialog open={!!deleteMatch} onClose={() => setDeleteMatch(null)}>
          <DialogTitle>Delete Match</DialogTitle>
          <DialogContent>
            <DialogContentText>
              Are you sure you want to delete the match between "{deleteMatch?.team1}" and "{deleteMatch?.team2}"?
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <Button onClick={() => setDeleteMatch(null)}>Cancel</Button>
            <Button onClick={handleDelete} color="error">Delete</Button>
          </DialogActions>
        </Dialog>
      </Box>
    </Container>
  );
}

export default Matches;
